var isLogin=true;

function LogIncheck(){
    if(isLogin){
        <h1>Hello</h1>
    }
    else{
        <form className="form">
        <input type="text" placeholder="Username"/>
        <input type="password" placeholder="Password"/>
        <button type="submit">LogIn</button>
        </form>
    }
}

function App(){
    return (
        <div className="container">
        {LogIncheck()}
        </div>
    );

}

export default App;
